function LandingPage() {
    return (
        <div className="container">

            <Jumbotron fluid>
                <Container>
                    <h1>Google Book Club</h1>
                    <p>
                        Find a book today.
                    </p>
                </Container>
            </Jumbotron>

            <Container fluid id="booksearch">

        

            </Container>

            <br></br>
            <br></br>

            <Container fluid id="resultsdiv" >
                <h1>Results</h1>
                <List />

            </Container>
        </div>
    )
}

export default LandingPage;
